import React from 'react';
import '../scss/custom.scss';

const NavItem = (props) => {
    const pageURI = window.location.pathname+window.location.search;
    return (
        <li className="nav-item active">
            <a className="nav-link" href={props.path}>{props.name} 
            /* {(props.path === pageURI) ? (<span className="sr-only">(current)</span>) : ''} */
            </a>
        </li>
    );
}

class Navigation extends React.Component {
    render() {
        return (
            <div>
                <nav className="navbar fixed-top navbar-expand-lg navbar-light">
                    <a className="navbar-brand" href="index.html">
                        &nbsp; <img src="./imgs/vd.png" height="40" alt="Vivian Do" />
                    </a>
                    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>

                    <div className="collapse navbar-collapse justify-content-end text-right" id="navbarSupportedContent">
                        <ul className="navbar-nav">
                            <NavItem path="index.html" name="HOME"></NavItem>
                            <li className="nav-item active">
                                <a className="nav-link" href="index.html#About">ABOUT <span className="sr-only">(current)</span></a>
                            </li>
                            <li className="nav-item active">
                                <a className="nav-link" href="portfolio.html">PORTFOLIO <span className="sr-only">(current)</span></a>
                            </li>
                            <li className="nav-item active">
                                <a className="nav-link" href="./documents/Do_Vivian_Resume_Online.pdf">RESUME <span className="sr-only">(current)</span></a>
                            </li>
                            <li className="nav-item active">
                                <a className="nav-link" href="index.html#Contact">CONTACT <span className="sr-only">(current)</span></a>
                            </li>
                        </ul>
                    </div>
                </nav>
            </div>
        )
    } 
};

export default Navigation;
